/* eslint-disable */
const jsPDF = require('jspdf');

function getPdfDocument(orientation, unit, format) {
	const normal = '';
	const bold = '';

	const doc = new jsPDF(orientation, unit, format);

	doc.addFileToVFS("myfont-normal.ttf", normal);
	doc.addFileToVFS("myfont-bold.ttf", bold);
	doc.addFont('myfont-normal.ttf', 'MyFont', 'normal');
	doc.addFont('myfont-bold.ttf', 'MyFont', 'bold');

	return doc;
}

export { getPdfDocument };